  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113529 includes chemical,
  discrete sample, physical and profile data collected from CORNIDE DE SAAVEDRA in
  the North Atlantic Ocean from 1993-05-10 to 1993-06-01 and retrieved during cruise
  CARINA/29CS19930510. These data include ALKALINITY, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD and bottle. These data were collected by F. Perez of Commonwealth Scientific
  and Industrial Research Organization and J.M. Cabanas [affiliation unknown] as part
  of the CARINA/29CS19930510 data set.nnThe CARINA (CARbon dioxide IN the Atlantic
  Ocean) data synthesis project is an international collaborative effort of the EU
  IP CARBOOCEAN, and U.S. partners. It has produced a merged internally consistent
  data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
